INSERT INTO phpbb_posts_text (post_id, bbcode_uid, post_subject, post_text) VALUES('209', '', '', 'Sounds like a bad behaviour. For what I see, the datfile is correct and the NeoGeo bios appears as a resource. Be sure that in Scanner -&gt; Advanced Options (the button), the option \"Allow not separated BIOS files\" is disabled. If you have it disabled, then you might have better luck asking directly to Roman in the ClrMamePro forum.');
