INSERT INTO phpbb_posts_text (post_id, bbcode_uid, post_subject, post_text) VALUES('214', '6fa76aa683', '', 'Incidentally, I\'ve been informed that the Dragon\'s Lair project has all 4 ROMs that are needed for badlandh but this is not quite the case. The data file that I have produced has been generated from ROM definitions inside Daphne itself and thus the ROM names, sizes and CRCs are all as the emulator expects. Any ROMs that you find elsewhere of different names, sizes or CRCs are not actually supported by Daphne.
