INSERT INTO phpbb_posts_text (post_id, bbcode_uid, post_subject, post_text) VALUES('228', '', '', 'It is in MAME as a clone of ffight, but it\'s not CPS1 and IIRC it doesn\'t even share any roms with the parent. It\'s a similar 68k based hardware by Playmark. I don\'t think there are any differences in gameplay with the original either.');
