INSERT INTO phpbb_posts_text (post_id, bbcode_uid, post_subject, post_text) VALUES('230', 'bebe1277f6', 'Warnings when loading MAME 0.101 dat', 'When I load MAME 0.101 dat in ClrMamePro I get some warnings:
INSERT INTO phpbb_posts_text (post_id, bbcode_uid, post_subject, post_text) VALUES('231', '2af86aaa42', '', 'According to the source, it\'s similar to CPS1 but not the same. The driver even loads cps1.h too. Of course it can\'t be too different or making a bootleg in different hardware wouldn\'t be worth the effort. Sound hardware is very different tho. I\'ve noticed that one of the things which bootleggers change first is sound hardware.');
INSERT INTO phpbb_posts_text (post_id, bbcode_uid, post_subject, post_text) VALUES('232', '', '', 'The wrong bios names it\'s just a matter of tastes. Even when the rom is the same as in the other sets, in that particular board it could have been named differently. So the developer who made the driver chose to keep the board name instead. The problem comes because the merged name is set also to this different name, and ClrMamePro sees it as a bug in the datfile (and technically, it is). So you could choose to have a rom with that name in the game set, or set it as the bios name which will be in the bios set. The difference would be zero as long as you have both sets, since MAME will search for it in the bios set if it\'s not in the game zip, regardless of the rom name.  It\'s not a problem by itself although I think it should be corrected at MAME source level.
